import React,{useState} from 'react';
import { NavLink } from 'react-router-dom';
export default function Sublist() {

    const [isSelected,setIsSelected] = useState(false);

    const EventBackground = (e) => {
        e.target.setIsSelected(true);
        e.target.setAttribute({color: "black"});
    }

    return (
        <div className="sublist">
            <NavLink to="/Wbnx1" className="navlink" onClick={EventBackground}>WBN_X1(R0)</NavLink>
            <NavLink to="/Wbnx2" className="navlink">WBN_X2(R0)</NavLink>
            <NavLink to="/Wbnx3" className="navlink">WBN_X2(AP1)</NavLink>
            <NavLink to="/Wbnx4" className="navlink">WBN_X2(AP2)</NavLink>
            <NavLink to="/Wbnx5" className="navlink">WBN_X4(AP4)</NavLink>
        </div>
    )
}
